"title": "Welcome to Stella&#39;s Shoppe",
"announcement": "Welcome to Stella‚Äôs Shoppe!\r\n\r\nThere are two things in life I love above anything else- babies and dogs. My shoppe is named after my fur-baby Stella, the puggle on the left in the photograph.\r\n\r\nWe are an online-based baby boutique- offering a variety of baby onesies. It&#39;s just myself working out of my home office- no staff here! \r\n\r\nWe are open to custom orders so if you have an idea or something special you&#39;d like to have made, please contact us with your ideas.  I hope you find my designs and ideas fun and lighthearted. I hope you enjoy them as much as I do making them. I always appreciate your stories and feedback. \r\n\r\nThank you for stopping by...We hope to see you again soon!",
