"accepts_custom_requests": true,
"policy_welcome": "Welcome to Stella‚Äôs Shoppe!\r\n\r\nWe are an online-based baby, toddler, and dog boutique- offering a variety of baby onesies, toddler shirts, and dog shirts. We are open to custom orders so if you have an idea or something special you&#39;d like to have made, please contact us with your ideas. If you are happy with your purchase please share us with your friends. \r\n\r\nThank You for stopping by...We hope to see you again soon!",
"policy_payment": "We accept credit/debit cards through direct checkout as well as Etsy gift cards.\r\n\r\n**Safe secure checkout. Your payment information is never exposed.\r\n\r\nYou may pay by......\r\n- Mastercard\r\n- Visa\r\n- Discover\r\n- American Express\r\n- Debit Card\r\n- Etsy Gift Card \r\n\r\nSorry, but we DO NOT accept checks or money orders. Orders will not be processed or shipped until payment has cleared.",
"policy_shipping": "Processing and Shipping:\r\n\r\nOrders will ship to the address on your Etsy invoice unless we have been emailed directly for any changes. All items will be shipped First Class USPS unless other arrangements have been made prior to the shipment of your order. All orders will be shipped within 1-3 business days. If your order was placed on a holiday or weekend, it will be processed the following business day. If you would like to make arrangements to have your order rushed, please email us before you place your order for a quote. We ship merchandise to locations within the United States and U.S. territories, including Alaska, Hawaii, Puerto Rico, Guam, and the US Virgin Islands. We also ship Internationally. Please allow 1-6 Weeks for International Shipping. International shipping times vary and will depend on the amount of time the package takes to get through your customs department in addition to your postal service. We cannot take responsibility for the time it takes to get to you. We can only be responsible for when we ship your order.\r\n\r\nShipping Rates:\r\n\r\nUnited States & US.Territories\r\n$3.99 & 2.99 With Another Item\r\nCanada\r\n$5.99 & $4.99 With Another Item\r\nInternational\r\n$7.99 & $6.99 With Another Item\r\n",
"policy_refunds": "Refunds and Exchange\r\nI&#39;m sorry we do not accept refunds or exchanges unless an error has been made on our part. In such a case we need to be contacted within 24 hours of receiving your package for return authorization, and the item(s) must be returned within 48 hours of receipt and an exchange will be made and shipped immediately. In some cases a refund may be given (less shipping). ",
