"policy_payment": "We accept PayPal and credit cards by phone.",
"policy_shipping": "Orders made within 1-2 days of purchase unless otherwise noted. Orders usually ship within 2-5 days from date of order. \r\n\r\nPlease note: Some countries outside of USA charge a customs fee when item arrives imported, based on value of item.  Buyer is responsible for import taxes or custom fees if required by destination country.  Thanks",
"policy_refunds": "Sorry, We do not offer refunds for custom made items. However, if there is an error on our part, we will gladly work with you to correct the problem.  We take pride in knowing our customers are satisfied with our work. Please note that a completed transaction via our Etsy store is a contract between the buyer and seller.  By purchasing item, you understand that an order can not be canceled unless refund is first approved by seller.  Being that our items are usually processed within first 24 hours, we will not accept cancellation requests on orders that are already in processing.  Any approved cancellation will result in refund minus $10 cancellation fee to cover seller fees charged to seller for completed transaction.  Items costing more than $100 may result in restock fee no more than 10% of actual sale.  Measurement kits are free with purchase of grillz only and can not be reused if  returned for sanitary reasons.  If cancelation of a grillz order is approved prior to the actual making of order, a refund will be given minus $25 for the measurement kit and cost of shipping charges. No cancelation will be made for orders already made or in casting process.\r\n\r\nAll handmade items should be cared for as such.  For example, we don&#39;t recommend working out or doing yard work in handmade jewelry to prevent breakage.  Care for our jewelry with care and our pieces will give you years of enjoyment.  Being that items are handmade, we do not offer warranty against breaking.  However under certain conditions, we may be able to fix item for free within a reasonable time if the breakage was premature and due to faulty design.  Any item that breaks by fault of customer can be fixed at a fair price only unless the damage is extreme such as intentional neglect or poor care for the item.",
"policy_additional": "Our handmade jewelry items are guaranteed to be of quality.  Handmade items are unique and small imperfections are normal in custom jewelry.  Our staff is well trained in making jewelry and carefully inspecting pieces before shipping items to customer.",
