"title": "Hip Hop Coaster Set (*Pick Your 6!)",
"description": "I think it is safe to assume that most people if not everyone loves hip hop but not everyone likes the same artist so this classic Hip Hop set is now a pick your own. You can now pick 6 out of the 16 to create your own custom Hip Hop set featuring some of your favorites. This is a set that I will be continuously adding to, if there is a relatively popular artist that you know and love that is not feature feel free to send over an inquiry as it may be someone I am willing or planning to create a coaster for. ***Keep in my mind that while making this request, that it is unlikely that I will be doing lesser known artists. If he/she is a local or underground artist it would be more of a custom request thus the price and listing will need to be different*** \n\nIf there is a hip hop artist featured on another set that you like and would like to see here i.e Q Tip from ATCQ please see the following listing:https://www.etsy.com/listing/109059238/build-your-own-5pc-coaster-set?ref=shop_home_feat_1d with a 2.0mm thickness. \n\nCoasters are on heavyweight cardboard- 4x4 and 2mm thick this is thicker than the standard bar coaster \n\nCoasters are created using stencils and water proof paint followed by a sealer. Condensation rolls right off.  \n\nSpice up your small party with these mini paintings!\n\nBe sure to state who you want in the notes\nAs pictured left to right\n*Jay Z\n*Nas\n*Tupac\n*ODB\n*Biggie\n*Drake\n*Rick Ross\n*J COle\n*MF DOOM\n*Childish Gambino\n*Kendrick Lamar\n*Mos Def\n*Snoop Dogg\n*Ice Cube\n*Kanye West\n*Eazy E\n\nWomen Just added - \n*Queen Latifah\n*Nicki Minaj\n*Lauryn Hill\n*Missy Elliott\n*Lil Kim\n*Foxy Brown\n(too come MC Lyte, Trina, Left eye, Eve, yoyo, MIA etc)\n\n\nIf you fail to note who you want you will receive the default five plus one selected at random (biggie, tupac, nas, jay z and odb)\n\nThe set is made to order and the color combo  may vary. If you have a preference or would like them all to be one color please let me know in the notes. Standard Colors are always available: blue, red, yellow, green, purple, and orange. Special colors may vary.\n\n\n\n*Domestic shipping price includes tracking and insurance\n*Shipping reflects recent changes in postage prices for shipping outside the US\n\nMore images coming soon",
