"policy_welcome": "     Artist Richard Ian Cohen grew up in the warmth of the South Florida / Miami sun and waters. In particular, the Florida Keys played a major influence on his being. His art is influenced by the surrounding environment of the ocean and marine creatures. Sunsets, exploding Sailfish, the deep blue / purple hues of the open ocean were just a few of the resources he gathered and implemented in his creations.\r\n     Whether the medium be painting, sculpting, photography, charcoals, apparel or music, his desire to create has led to new ways of expressing his passions. Richard moved to Los Angeles in 1992 and for the past decade, the artist has discovered glitter as a unique medium and has concentrated on refining this aspect of his creations.\r\n     These glitter paintings have been showcased on the Tonight Show with Jay Leno and featured in the home of Bob Marley&#39;s mother. Owners include model Aria Giovanni, Grammy Award winners Dr. John, Cyril Neville, Aaron Neville and Ziggy Marley among others. He has had featured works at L.A. Downtown Art Walk, various underground Los Angeles Art Shows and on Abbot Kinney in Venice Beach California.",
